import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import CardList from './CardList';
import reportWebVitals from './reportWebVitals';
import 'tachyons';
import corgis from './Corgis';

ReactDOM.render(
  <div>
    <Card id={corgis[0].id} name={corgis[0].name} owner={corgis[0].owner} personality={corgis[0].personality} />
    <Card id={corgis[1].id} name={corgis[1].name} owner={corgis[1].owner} personality={corgis[1].personality} />
    <Card id={corgis[2].id} name={corgis[2].name} owner={corgis[2].owner} personality={corgis[2].personality} />
    <Card id={corgis[3].id} name={corgis[3].name} owner={corgis[3].owner} personality={corgis[3].personality} />
  </div>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
